  return (
    <header className="App-header">
      {/* Add the logo image */}
      <img src={mgilogo} alt="Logo" style={{ height: '50px' }} /> {/* Adjust the size as needed */}
      <h1>My Website</h1>
      <HeaderLinks />
    </header>
  );
}

export default Header;
